import React from 'react'
import '../../App.css'
import '../HeroSection.css'
import { Button } from '../Button';
import StyleTable from '../DataTable/StyledTableCell'

const AppDrawar = () => {
  return (
    <div>
      <Button buttonStyle='btn--outline'>SIGN UP</Button>
      <StyleTable />
    </div>
  )
}

export default AppDrawar
